import './App.css';
import Style from './components/Style';
import GlobalStyle from './components/GlobalStyle';
import Mainbanner from './components/Mainbanner';

function App() {
  return (
    <div className='App'>
      <GlobalStyle />
      <Mainbanner />
      <Style />
    </div>
  );
}

export default App;

